module.exports = /*#__PURE__*/JSON.parse('{"tag":{"label":"Oracle Pro","permalink":"/whatap-docs/tags/oracle-pro","allTagsPath":"/whatap-docs/tags","count":41,"items":[{"id":"oracle-pro/flex-board","title":"Flex 보드","description":"사용자 정의형 통합 대시보드를 안내합니다. 사용자는 애플리케이션, 서버, 데이터베이스, 컨테이너 등의 데이터로 실시간 대시보드를 만들 수 있습니다. 사전 구성된 템플릿을 제공하며, 다양한 데이터 위젯 추가, 데이터 필터링, 시간 범위 설정 등의 기능을 통해 사용자가 원하는 모니터링 대상을 쉽게 간추리고 중요 데이터를 확인할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/flex-board"},{"id":"oracle-pro/flexboard-share","title":"Flex 보드 공유하기","description":"Flex 보드를 다른 계정의 사용자와 공유하고 재사용할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/flexboard-share"},{"id":"oracle-pro/flexboard-manage","title":"Flex 보드 관리하기","description":"Flex 보드에서 대시보드를 편집하고 관리하는 방법을 안내합니다. 대시보드의 이름 변경, 프로젝트 선택, 레이아웃 조정 등을 포함하며, 위젯의 추가, 이동, 크기 조절, 삭제 방법도 확인할 수 있습니다. 또한, 위젯의 데이터 소스를 선택하는 방법과 대시보드의 json 형식으로의 내보내기 기능도 제공합니다.","permalink":"/whatap-docs/oracle-pro/flexboard-manage"},{"id":"oracle-pro/flexboard-create","title":"Flex 보드 만들기","description":"Flex 보드 메뉴에서 대시보드를 생성하고, 위젯을 배치하여 사용자 정의 대시보드를 만드는 과정을 안내합니다. 고정 레이아웃과 반응형 레이아웃 중에서 선택할 수 있으며, 메트릭스 위젯 추가 및 사전 정의된 위젯 템플릿을 활용할 수 있습니다. 사용자는 위젯의 위치를 조정하고, 크기를 변경하여 자신만의 대시보드 레이아웃을 완성할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/flexboard-create"},{"id":"oracle-pro/flexboard-mode","title":"Flex 보드 화면 모드","description":"Flex 보드의 화면 모드에 따라 제공하는 기능에 대해 알아보세요.","permalink":"/whatap-docs/oracle-pro/flexboard-mode"},{"id":"oracle-pro/check-ipckey","title":"ipckey 값 확인하기","description":"한 서버에 여러 개의 데이터베이스를 설치한 환경에서 ipckey를 확인하는 방법을 안내합니다.","permalink":"/whatap-docs/oracle-pro/check-ipckey"},{"id":"oracle-pro/monitoring-intro","title":"Oracle Pro 모니터링","description":"와탭 데이터베이스 모니터링 서비스(DBX)은 Query 기반으로 데이터를 수집하여 성능 모니터링 서비스를 제공합니다.","permalink":"/whatap-docs/oracle-pro/monitoring-intro"},{"id":"oracle-pro/metrics-data-list","title":"Oracle Pro 지표","description":"Oracle Pro 지표를 안내합니다.","permalink":"/whatap-docs/oracle-pro/metrics-data-list"},{"id":"oracle-pro/sga-size","title":"SGA 사이즈","description":"오라클 서버 메모리 영역인 SGA 요약 정보를 매 시간 저장하여 시간별 변화량을 모니터링할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/sga-size"},{"id":"oracle-pro/stat","title":"SQL 통계","description":"Oracle의 데이터베이스별 통계 데이터를 제공합니다.","permalink":"/whatap-docs/oracle-pro/stat"},{"id":"oracle-pro/analysis-compare-top-sql","title":"Top SQL 비교","description":"특정 날짜를 기준으로 설정된 시간대의 SQL의 추이를 비교하고 등락을 확인할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/analysis-compare-top-sql"},{"id":"oracle-pro/analysis-wait-events","title":"Wait 분석","description":"Wait 분석","permalink":"/whatap-docs/oracle-pro/analysis-wait-events"},{"id":"oracle-pro/set-receive-event","title":"경고 알림 수신 설정","description":"프로젝트에 포함하는 멤버들의 경고 알림 수신과 관련한 다양한 기능을 설정할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/set-receive-event"},{"id":"oracle-pro/agent-manage","title":"관리하기","description":"whatap.conf 파일을 통해 데이터베이스 에이전트를 관리할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/agent-manage"},{"id":"oracle-pro/dashboard-intro","title":"대시보드","description":"와탭 모니터링 대시보드는 프로젝트의 전체 현황을 한 눈에 파악하기 위한 기능을 제공합니다.","permalink":"/whatap-docs/oracle-pro/dashboard-intro"},{"id":"oracle-pro/analysis-databaseparameter","title":"데이터베이스 파라미터 조회","description":"데이터베이스의 파라미터 값을 조회하고 날짜별로 비교할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/analysis-databaseparameter"},{"id":"oracle-pro/analysis-lock-and-deadlock","title":"락 트리","description":"하루 동안 발생한 Lock 추이를 분석하고 교착 상태의 쿼리를 확인할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/analysis-lock-and-deadlock"},{"id":"oracle-pro/multi-instance-monitoring","title":"멀티 인스턴스 모니터링","description":"다수의 데이터베이스 인스턴스 핵심 지표를 통합해 확인할 수 있는 기능을 제공합니다.","permalink":"/whatap-docs/oracle-pro/multi-instance-monitoring"},{"id":"oracle-pro/metrics-intro","title":"메트릭스","description":"데이터베이스 모니터링 분석을 위한 메트릭스 메뉴에 대해 알아봅니다.","permalink":"/whatap-docs/oracle-pro/metrics-intro"},{"id":"oracle-pro/metric-warning-notice","title":"메트릭스 경고 알림","description":"구체적이고 복잡한 이벤트를 설정하려면 메트릭스 이벤트 설정을 사용하세요.","permalink":"/whatap-docs/oracle-pro/metric-warning-notice"},{"id":"oracle-pro/flexboard-metric-widget","title":"메트릭스 위젯","description":"프로젝트의 성능 지표를 나타내는 메트릭스 데이터를 위젯 형태로 대시보드에 추가하는 방법을 안내합니다. 메트릭스는 카테고리로 분류되고, 태그를 이용해 데이터를 탐색할 수 있으며, 테이블 위젯과 시리즈 위젯 두 가지 유형으로 제공합니다.","permalink":"/whatap-docs/oracle-pro/flexboard-metric-widget"},{"id":"oracle-pro/metrics-detect-anormal","title":"메트릭스 이상 탐지","description":"다양한 메트릭스 지표의 패턴을 AI가 학습한 예상 패턴과 비교해 볼 수 있습니다.","permalink":"/whatap-docs/oracle-pro/metrics-detect-anormal"},{"id":"oracle-pro/analysis-pq-tree","title":"병렬 쿼리 트리","description":"description","permalink":"/whatap-docs/oracle-pro/analysis-pq-tree"},{"id":"oracle-pro/report-intro","title":"보고서","description":"개별 프로젝트에 대해 서비스 이용 현황과 장애 발생 기록을 보고하는 문서에 대해 알아봅니다.","permalink":"/whatap-docs/oracle-pro/report-intro"},{"id":"oracle-pro/flexboard-template","title":"사전 템플릿 적용","description":"Flex 보드에서 사용자 정의 대시보드를 빠르게 구성할 수 있는 사전 설정된 템플릿을 안내합니다. 사용자는 초기 설정을 간편하게 진행하고, 필요에 따라 설정을 변경하여 활용할 수 있습니다. 템플릿 선택부터 이름 지정, 레이아웃 조정, 저장에 이르기까지의 단계를 확인하고, 사용자는 효과적으로 모니터링 대시보드를 만들 수 있습니다.","permalink":"/whatap-docs/oracle-pro/flexboard-template"},{"id":"oracle-pro/agent-settings","title":"설정하기","description":"데이터베이스 에이전트 서버에 있는 whatap.conf 파일을 통해 설정할 수 있는 옵션에 대해 알아봅니다.","permalink":"/whatap-docs/oracle-pro/agent-settings"},{"id":"oracle-pro/troubleshooting","title":"설치 문제 해결","description":"데이터베이스 에이전트 설치 시 발생할 수 있는 문제를 확인할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/troubleshooting"},{"id":"oracle-pro/after-install-agent","title":"설치 점검 사항","description":"데이터베이스 모니터링 설치를 모두 완료했습니다. 설치 후 확인 사항을 점검하세요.","permalink":"/whatap-docs/oracle-pro/after-install-agent"},{"id":"oracle-pro/analysis-session-history","title":"세션 히스토리","description":"장시간 수행된 세션에 대해 수행 중인 SQL이 얼마나 자원을 사용했는지 확인하고 원인을 분석할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/analysis-session-history"},{"id":"oracle-pro/set-notification-message","title":"알림 메시지 사용자 정의","description":"프로젝트 멤버에게 전달되는 경고 알림 메시지를 수정할 수 있는 사용자 정의 기능을 제공합니다.","permalink":"/whatap-docs/oracle-pro/set-notification-message"},{"id":"oracle-pro/set-notice","title":"알림 설정하기","description":"이벤트 조건을 설정하고 다양한 형태로 알림을 받을 수 있습니다.","permalink":"/whatap-docs/oracle-pro/set-notice"},{"id":"oracle-pro/install-agent","title":"에이전트 설치","description":"와탭 데이터베이스 모니터링 서비스 이용을 위한 기본 설치 방법을 안내합니다.","permalink":"/whatap-docs/oracle-pro/install-agent"},{"id":"oracle-pro/flexboard-widget-manage","title":"위젯 관리하기","description":"Flex 보드에 배치한 위젯의 추가, 속성 변경, 복사, 삭제 방법을 안내합니다. 사용자는 위젯을 추가하거나 기존 위젯의 속성을 조정하여 대시보드를 개인화할 수 있습니다. 위젯의 데이터 조회 조건 변경, 시간 설정, 데이터 병합 옵션 설정 등 세밀한 관리 기능을 통해 사용자의 모니터링 요구에 맞는 대시보드를 구성할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/flexboard-widget-manage"},{"id":"oracle-pro/set-event-history","title":"이벤트 기록","description":"이벤트 기록 메뉴를 통해 발생한 경고 알림 이력을 확인할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/set-event-history"},{"id":"oracle-pro/warning-notice-v2","title":"이벤트 설정","description":"데이터베이스의 지표별 이벤트 조건 설정을 통해 경고 알림을 보냅니다.","permalink":"/whatap-docs/oracle-pro/warning-notice-v2"},{"id":"oracle-pro/set-event-format","title":"이벤트 수신 포맷","description":"데이터베이스 모니터링에서 제공하는 경고 알림의 이벤트 수신 포맷에 대해 알아봅니다.","permalink":"/whatap-docs/oracle-pro/set-event-format"},{"id":"oracle-pro/set-event-detect-anomal","title":"이상치 탐지 경고 알림","description":"예상치 못한 패턴을 찾는 일련의 활동을 탐지해 경고 알림을 보내도록 설정할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/set-event-detect-anomal"},{"id":"oracle-pro/instance-monitoring","title":"인스턴스 모니터링","description":"인스턴스 모니터링 메뉴에서는 데이터베이스 서버의 핵심 지표들에 대한 상세 정보를 실시간으로 확인할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/instance-monitoring"},{"id":"oracle-pro/instance-list","title":"인스턴스 목록","description":"에이전트를 설치한 데이터베이스 서버들의 목록을 확인할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/instance-list"},{"id":"oracle-pro/analysis-count-trend","title":"카운트 추이 활용하기","description":"데이터베이스 운용 추이를 확인하고 비교할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/analysis-count-trend"},{"id":"oracle-pro/table-space-size","title":"테이블스페이스 사이즈","description":"각 테이블 스페이스별 최대 용량과 사용량을 시간의 흐름에 따라 조회할 수 있습니다.","permalink":"/whatap-docs/oracle-pro/table-space-size"}],"unlisted":false}}');

